import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignUp extends Component {




    constructor(props) {
        super(props);
        this.state = {
            name: "",
            email: "",
            password: "",
            verify_password: ""
        };
    }

    onChangeName = (VerEmail) => {
        this.checkButton()
        this.setState({ verify_email: VerEmail.target.value })
    }
    onChangeEmail = (Email) => {
        this.checkButton()
        this.setState({ email: Email.target.value })
    }
    onChangePassword = (Password) => {
        this.checkButton()
        this.setState({ password: Password.target.value })
    }
    onChangeVerPassword = (VerPassword) => {
        this.checkButton()
        this.setState({ verify_password: VerPassword.target.value })
    }



    checkButton = () => {

        const nameLabel = document.getElementById('nameLabel');
        const emailLabel = document.getElementById('emailLabel');
        const passwordLabel= document.getElementById('passwordLabel');
        const ver_passwordLabel = document.getElementById('ver_passwordLabel');


        if (this.state.name.length === 0) { nameLabel.innerText = 'Enter a valid user name' }
        else if (this.state.name.length > 0) { nameLabel.innerText = 'User name is too short'}


        else if (this.state.email.length < 7) { emailLabel.innerText = 'Email is too short' }
        else if (this.state.email.length === 0) { emailLabel.innerText = 'Enter a valid email' }
        else if (this.state.email.length > 30) { emailLabel.innerText = 'Email is too long' }
        else if (!this.state.email.includes("@" , ".")) { emailLabel = 'Enter a valid email' }

        else if (this.state.password.length === 0) { passwordLabel.innerText = 'Enter a valid password' }
        else if (this.state.password.length < 8) { passwordLabel.innerText = 'Password should be greater than 8 letters' }

        else if (this.state.verify_password < 8) { ver_passwordLabel.innerText = 'Password verfication is not the same' }
        else if (this.state.password !== this.state.verify_password) { ver_passwordLabel = 'Password verfication is not the same' }


        else {
            document.getElementById("checkButton").disabled = false;
            console.log(this.state)
        }
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown mt-5 pt-5">
                    <div id="formContent">
                        <h2 className="active signh2"> Sign Up </h2>
                        <div className="fadeIn first mt-2 mb-2">
                            <i className="fa-solid fa-user fa-6x"></i>
                        </div>


                        <form id="signUpForm" onSubmit={() => { console.log(this.state); }} action="/Dashboard" method="POST" >
                            
                            <input
                                type="text"
                                name="name"
                                placeholder="User name"
                                onChange={this.onChangeName}
                                autocomplete="off"
                            />

                            <label id="nameLabel" style={{ color: "red", fontSize: "13px" }}></label>


                            <input
                                type="email"
                                name="email"
                                placeholder="Email adress"
                                onChange={this.onChangeEmail}
                                autocomplete="off"
                            />

                            <label id="emailLabel" style={{ color: "red", fontSize: "13px" }}></label>



                            <input
                                type="password"
                                name="password"
                                placeholder="Password"
                                onChange={this.onChangePassword}
                                autocomplete="off"
                            />

                            <label id="passwordLabel" style={{ color: "red", fontSize: "13px" }}></label>

                            <input
                                type="password"
                                name="verify_password"
                                placeholder="Verify Password"
                                onChange={this.onChangeVerPassword}
                                autocomplete="off"
                            />

                            <label id="ver_passwordLabel" style={{ color: "red", fontSize: "13px" }}></label>

                            <br />
                            <input type="submit" className="fadeIn Submitinput" id="checkButton" value="SIGN UP" disabled />

                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/login">Already a member ?</Link>
                        </div>

                    </div>
                </div></div>
        )
    }
}

export default SignUp
